import React from 'react';
import Slider from 'react-slick';
import styled from 'styled-components';

function Roadmap() {
    var settings = {
            arrow: true,
            infinite: false,
            speed: 400,
            slidesToShow: 4,
            slidesToScroll: 1
        };

    return (
        <RoadmapSection>
            <RoadmapContainer>
                <div>
                    <h2>Adaptive height</h2>
                    <Slider {...settings}>
                        <div>
                            <RoadmapItemHolder className="roadmap-bottom">
                                <RoadmapLiner>
                                    <Line/>
                                    <Dot/>
                                    <Line/>
                                </RoadmapLiner>
                                <RoadmapDate>Q2 2017</RoadmapDate>
                                <RoadmapContent>
                                    Aliquam lorem ante, dapi bus in, viverra quis, feugi at a, tel lus. Phaselus vive
                                </RoadmapContent>
                            </RoadmapItemHolder>
                        </div>
                        <div>
                            <RoadmapItemHolder className="roadmap-top">

                            </RoadmapItemHolder>
                        </div>
                        <div>
                            <h3>3</h3>
                            <p>See ....</p>
                            <p>Height is adaptive</p>
                        </div>
                        <div>
                            <h3>4</h3>
                        </div>
                        <div>
                            <h3>5</h3>
                        </div>
                        <div>
                            <h3>6</h3>
                        </div>
                    </Slider>
                </div>
            </RoadmapContainer>

        </RoadmapSection>
    );
}

const RoadmapSection = styled.section`
    color: #fff;
    background: #141515;

    padding: 0 10%;

    min-height: 550px;
    position: relative;
`

const RoadmapContainer = styled.div`
    height: 50%;
    .roadmap-top{
    }

    .roadmap-bottom{
        margin-top: 80.05%;
    }
`

const RoadmapItemHolder = styled.div`
`
const RoadmapLiner = styled.div``

const Line = styled.div``

const Dot = styled.div``


export default Roadmap;
